from helpers.test import getOutcome

class Solution(object):
  def repeatedStringMatch(self, A, B):
    lengthA, lengthB = len(A), len(B)
    times = lengthB // lengthA
    for currentTimes in range(times, (10000 // lengthA) + 1):
      if (A * (currentTimes)).find(B) != -1:
        return (currentTimes)
    return -1

s = Solution()
print(s.repeatedStringMatch("abcd", "cdabcdab"))
print(s.repeatedStringMatch("a", "aa"))
print(s.repeatedStringMatch("abababaaba", "aabaaba")) # 2

print(s.repeatedStringMatch("a", ""))
